def can_transform_to_identity_permutation(n, m, table):

    def get_perms(perm):
        perms = {tuple(perm)}
        for i in range(len(perm)):
            for j in range(i + 1, len(perm)):
                perm_copy = list(perm)
                (perm_copy[i], perm_copy[j]) = (perm_copy[j], perm_copy[i])
                perms.add(tuple(perm_copy))
        return perms
    good_perms = get_perms([i for i in range(1, m + 1)])
    for i in range(n):
        perm = table[i]
        good_perms &= get_perms(perm)
    return '' if good_perms else 'NO'

